		function onSAGEInitialized() {
			var number_of_charts = getSAGENumberOfCharts();
			var container = document.querySelector('.SAGE_chart_collection');

			for (var i = 0; i < number_of_charts; i++) {
				var id = getSAGEChartDomain(i);
				//console.log('Chart #${i}: ${value}');

				// Create a new chart container div
				var chartContainer = document.createElement('div');
				chartContainer.className = 'SAGE_chart_container'; // Add the class for styling

				// Create a new div for the chart inside the chart container
				var chartDiv = document.createElement('div');
				chartDiv.id = id; // Set the id to the chart ID

				// Append the chart div to the chart container
				chartContainer.appendChild(chartDiv);

				// Append the chart container to the main container
				container.appendChild(chartContainer);

				RegisterSAGEChart(id);
			}
		}

	</script>
